import React from 'react';
import RenderReview from '../Components/RenderReview';

const ReviewContainer = (props) => {
    let mappedReviews = props.perfume.reviews.map(review => {
      return <RenderReview key={review.id} review={review} updateHandler={perfume.updateHandler}/>
     }
    )

    return (
      <div>
        <h1 className="review-main-title">Reviews</h1>
        <div>{mappedReviews}</div>
      </div>
    )
}

export default ReviewContainer;
